requirement.content:
Соответствие требованиям, установленным в соответствии с законодательством Российской Федерации к лицам, осуществляющим поставку товара, выполнение работы, оказание услуги, являющихся объектом закупки: 
- участник электронного аукциона должен быть членом саморегулируемой организации (далее – СРО) в области архитектурно-строительного проектирования, при этом СРО, в которой состоит участник аукциона в электронной форме, должна иметь компенсационный фонд обеспечения договорных обязательств; 
- участник должен иметь право осуществлять подготовку проектной документации по договору подряда на подготовку проектной документации, заключаемому с использованием конкурентных способов заключения договоров в отношении объектов капитального строительства (кроме особо опасных, технически сложных и уникальных объектов, объектов использования атомной энергии);
- совокупный размер обязательств участника электронного аукциона по договорам, заключаемым с использованием конкурентных способов, не должен превышать уровень ответственности участника по компенсационному фонду обеспечения договорных обязательств; 
- уровень ответственности участника закупки члена саморегулируемой организации по обязательствам по договору подряда на подготовку проектной документации, и стоимости работ по одному договору, в соответствии с которым указанным членом внесен взнос в компенсационный фонд возмещения вреда должен быть не менее цены контракта предложенной участником на аукционе.
